import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

let BarChart = require("./BarChart.js");

function App() {
  let state = {
    data: [12, 5, 6, 6, 9, 10],
    width: 700,
    height: 500
  };
  return (
    <div className='App'>
      <BarChart
        data={this.props.state.data}
        width={this.props.state.width}
        height={this.props.state.height}
      />
    </div>
  );
}
export default App;
